----- EJEMPLOS

CREATE TABLE private.alumno(
	cod_alumno serial,
	nombres character varying(75) NOT NULL,
	apellidos character varying(75) NOT NULL,
	dpi character varying(35),
	telefono character varying(15),
	fec_nacimiento timestamp,
	PRIMARY KEY(cod_alumno)
);

CREATE INDEX idx_alumno_names ON private.alumno(nombres);

SELECT * from private.alumno
where nombres like '%Dy%';

DROP VIEW private.vw_alumno;

CREATE VIEW private.vw_alumno AS 
SELECT nombres, apellidos, fec_nacimiento 
FROM private.alumno;

SELECT * FROM private.vw_alumno;

